// Navbar.js
import React from 'react';
import './Navbar.css';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
            <link>home</link>
        </li>
        <li>settings</li>
        <li>movies</li>
      </ul>
    </nav>
  );
};

export default Navbar;
